  \"2016-04-11T23:38:56.863617\",\n\t\"name\": \"2010-or-dogami-glass-buttes-study-area\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Metadata for the LAS files was not provided
  to NOAA OCM. This metadata record contains information derived from the Watershed
  Sciences, Inc. lidar report. This report may be accessed at: https://coast.noaa.gov/htdata/lidar1_z/geoid12a/data/1475/supplemental/GlassButtes.pdf
  This LiDAR data set was collected between May 8 and May 14, 2010 and falls in portions
  of Deschutes, Harney, and Lake counties in the Glass Buttes area of Oregon. The
  total pulse density is 9.26 pulses per square meter over terrestrial surfaces. The
  requested lidar area of interest (AOI) totaled 84,849 acres, but was buffered to
  ensure data coverage, resulting in a total area flown (TAF) of 86,631 acres. This
  data set consists of ground (bare earth) and unclassified points. In some areas
  of heavy vegetation or forest cover, there may be relatively few ground points in
  the LiDAR data. Elevation values for open water surfaces are not valid elevation
  values because few LiDAR points are returned from water surfaces. LiDAR intensity
  values were also collected.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
